import Sidebar from '../components/Sidebar';
import Main from '../components/Main';
import { MainContainer } from '../styles/StyledStore';
import styled from 'styled-components';

const StyledMainContainer = styled(MainContainer)

function Home() {
  return (
    <MainContainer>
      <Main />
      <Sidebar />
    </MainContainer>
  );
}

export default Home;
